          'absolute right-1 z-10 text-center text-white bg-red-600 rounded-full top-1',
          sizeStyles[size || 'md'],
          className?.badge
        )}
      >
        {!count ? '' : count < 10 && count > 0 ? count : '9+'}
      </div>
    </div>
  )
}

